{
  "trailingComma": "es5",
  "semi": false,
  "singleQuote": true
}

/**



*/

module.exports = {
  extends: ['@commitlint/config-conventional'],
  rules: {
    // Casing: Use whatever casing you'd like!
    'header-case': [0],
    'scope-case': [0],
    'subject-case': [0],
    'header-max-length': [0],
  },
}

{
  "$schema": "https://turborepo.org/schema.json",
  "pipeline": {
    "build": {
      "dependsOn": ["^build"],
      "outputs": ["dist/**", ".next/**"]
    },
    "test": {
      "dependsOn": ["build"]
    },
    "types": {
      "dependsOn": ["build", "^types"],
      "outputs": [
        "dist/**"
      ]
    },
    "lint": {
      "dependsOn": ["build"]
    }
  }
}

/**



*/

module.exports = (packageJson) => {
  const gitRevision = `${packageJson.name}@${packageJson.version}`
  const outDir = `${__dirname}/docs/${gitRevision}`

  // TODO: If current branch is not `master` or `latest` then gitRevision is the current branch

  return {
    ignoreCompilerErrors: 'true',
    exclude: [
      '**/*+(index|.spec|.test|.e2e).ts',
      '**/*+(index|.spec|.test|.e2e).tsx',
    ],
    out: outDir,
    excludeNotExported: false,
    gitRevision,
  }
}
